import { CHANGE_ANIME_LOADING } from '../action_constant';
import axios from 'axios';

const axiosInstance = axios.create({
    baseURL: 'https://api.jikan.moe/v4',
    headers: {
        'Content-Type': 'application/json',
    },
});

export const fetchAnimeList = (data = null) => (dispatch) => {
    // dispatch({ type: GET_MOVIE_LOADING });
    axiosInstance.get('/anime')
        .then((res) => {
            console.log('res', res);
        })
        .catch((err) => {
            console.log('err', err);
        })
}
